import React, { useState } from "react";
import "./index.css";

const App = () => {
  let [nam, nameChange] = useState({
    fname: ' Muhammad',
    lname: '',
    email: '',
    no: '',
  })
  let thisPut = (obj) => {
    const value = obj.target.value;
    const name = obj.target.name;

    nameChange((pre) => {
    return({
      ...pre,
      [name]:value,
    })
    })
  }
  let sent = (event) => {
    event.preventDefault();
    alert('Submitted Successfully')
  }
  return (
    <>
      <form onSubmit={sent}>
        <div className="center">
          <div className="cen">
            <h1>Hello</h1>
           
            <input type="number" name='no' onChange={thisPut} />
            <button type='submit'>Submit</button>
          </div>
        </div>
      </form>
    </>
  )
}
export default App;
